[825487095]="Druści... nigdy... nie ustąpią...",
[825493979]="Nie wkładajcie mnie znów do golema...",
[825679741]="Ten osobnik rzeczywiście panuje nad swoim gniewem. Przez słowa młodego szczenięcia i czyny tego bohatera myślę, że zaczynam rozumieć. Są poznaczeni bliznami, to prawda, ale wiele się nauczyli. Ufam im.",
