[827176966]="Czy... to było wiadro brudnej wody po mopie?",
[827219403]="Mędrcy fal użyja Berła głębin, aby zamaskować nasze prawdziwe zamiary gęstą warstwą mgły. W międzyczasie flota zaatakuje Dazar'alor od południa.",
