[827474118]="Z ciemności, nadchodzą syreny!",
[827647585]="Wszędzie na tej wyspie znajduje się szczątkowa magia. Jeśli zbierzesz trochę Azsuniańskich pereł, będziemy mogli użyć ich jako katalizatora naszej magii.",
