[831723267]="Być może to są wasze niedoskonałości... które dają wam wolną wolę... a ona pozwala wam trwać na przekór kosmicznie obliczonym szansom. Zwyciężacie tam, gdzie zawiodły idealne wytwory Tytanów.",
