[832175374]="Do szeregu i zmiażdżyć tych głupców!",
[832189687]="Będziemy się utrzymywać,dopóki nie nadejdą posiłki. Tak długo, jak ludzie z tęgymi sercami będą obsadzać mury i tron, Stormwind będzie nie do zdobycia.",
