[833065096]="To matka wszystkich Bomb!",
[833287931]="Nie oczekuj litości. Ja nie okażę żadnej.",
[833339378]="Masz moje podziękowania.",
[833494491]="A poza tym mamy też Jakra'zeta, który knuje coś na pustyniach Vol'dun. Nie mam wątpliwości, że jest on dużym zagrożeniem zarówno dla Hordy, jak i mojego ludu.",
