[834269495]="Ty też, będziesz służyć!",
[834377319]="Czterej bracia. Każdy przyłożył rękę do zabicia ojca. Każdy przyłożył rękę do pozabijania się nawzajem. I tak oto Skovald został królem, gdyż jego ostrze było najszybsze.",
