[834528471]="Tam, gdzie nie ma światła, rozwijają się rozpacz, wstręt i wściekłość.",
[834530379]="Piekło już na nas czeka. Wydaj rozkaz!",
[834682351]="Nadszedł czas, by Dzieci Nocy poszukały sojuszników pośród królestw Azerothu. Jeśli nas przyjmiecie, będziemy dumni mogąc przyrzec wam nasze oddziały.",
[834736270]="Wow, tak, wspaniale! TAK SIĘ CIESZĘ, że $n pomógł ci w kopalni, odwlekając twą tragiczną i nieuchronną śmierć. To może teraz sobie stąd pójdziesz? Słyszałem, że w Tarren Mill mają jakąś robotę dla Opuszczonego twojego pokroju, Dumass.",
