[835170312]="Znajdź ukojenie w głębinach!",
[835207411]="Oddziały Lorda Stormsonga ustawiły kolejną blokadę! Zniszcz ją, żeby ci handlarze mogli przejść!",
[835345162]="Zostań w środku, Hanae! Awanturniku, sprawdź proszę, czy Delikatna Matka czegoś potrzebuje. Pracuje bez wytchnienia, doglądając znajdujących się wewnątrz ocalałych.",
[835402701]="Z nich wycofuje się Światłość, do momentu, w którym pozostaje tylko ciemność.",
[835515509]="Plujesz na mojego loa! Odgryzę ci za to usta!",
[835518271]="Zostań świadkiem swojego końca!",
[835524177]="Dobra, koniec czasu. Yi-Mo potrzebuje teraz pomocy! Załóżmy na niego maskę!",
[835602506]="A teraz doświadczysz prób Hulna...",
[835620818]="Czy postąpiliśmy... źle... wspierając Przymierze?",
[835768260]="Masz jeszcze wiele do nauczenia się, jeśli chcesz bronić swój lud przed Sha, nowicjuszu. Odsuń się, aby inni uczniowie mogli zająć twoje miejsce!",
[835880634]="Jak długo będę żyć, będę stać po twojej stronie... Jak ty robiłeś.",
[836013568]="Ty... zaczynasz działać mi na NERWY!!",
[836021985]="Myślałem, że wszystkich zabiliśmy... Mor'norokk powinien być zadowolony!",
[836055972]="Poddaj się albo giń, głupcze!",
[836142942]="Nie zostawaj tu zbyt długo.",
[836231142]="Zwój Ręki Losu jest tajemniczy, ale użyteczny. Nieumarli znowu roją się wzdłuż wybrzeża. Idź i przekonaj się do czego ten zwój może się przydać, co?",
