[1044776089]="Nie mogę sobie wyobrazić, co by się stało, gdyby przeprowadzili te rytuały. Dziękuję za pomoc.",
[1044840605]="Miażdżyć... okaleczać... NISZCZYĆ!",
[1044993018]="Brontes widzi wszystko.",
[1045017297]="Nasi żołnierze już teraz sobie poradzą. Odpocznij trochę przed następnym przydziałem, wojowniku. Zasłużyłeś na to.",
[1045049340]="Chciałem tylko trochę ciszy i spokoju!",
[1045100286]="Krew Prawdziwej Hordy pożąda mocy!",
[1045295817]="Mmm, te owoce wyglądają smakowicie! Zanieśmy je na stół z przekąskami.",
[1045364432]="Czujesz coś?",
[1045586267]="Być może nasi nowo przybyli sojusznicy coś poradzą.",
[1045634021]="Moja śmierć niczego nie powstrzyma...",
[1045689405]="Zróbcie to.",
[1045770402]="Płacę ci za pląsy, Greg, a nie za dąsy! Więc przyłóż się nieco!",
