[1046013760]="Raaar!!! Ja miażdżyć $r!",
[1046080681]="Mam właściwą bestię do tego specjalnego zadania.",
[1046118537]="Dla nas już za późno, żyjący. Weź swego przyjaciela i idźcie stąd, zanim zostaniecie... opętani...",
[1046217757]="Wodzu, myślę, że już czas wezwać Zandalari.",
[1046399198]="My zaatakujemy z drugiej strony, $c. Przymierze nie będzie się spodziewać ataku z ziemi w tak szybkim czasie. Znajdź mnie, gdy rzeź dobiegnie końca.",
[1046402181]="Uruchamiam urządzenie archiwizujące...",
[1046501551]="Honor, odwaga, współczucie i sprawiedliwość! Były to niegdyś cnoty, o które walczyłeś jako duchowny Srebrzystego Świtu, Thel'zanie.",
