[1046839828]="Hej, silnikogłowy! Dawaj tu!",
[1046941577]="Posmakujcie spaczenia świata!",
[1047079201]="A teraz zbierzcie wicher!",
[1047190332]="REGULATORZY! OGNIA!",
[1047268986]="Niech to Święto Księżyca i ten rok będą dla ciebie szczęśliwe, $c.",
[1047353576]="To ci się chyba spodoba!",
[1047356647]="Co... ja zrobiłem? Nie!",
[1047358648]="Trzymajcie się! Nikt nie zostanie odkażony, dopóki mam tu coś do powiedzenia!",
