[1047451025]="Ha! Dzisiejsze igrzyska uczczą wielkiego króla-czarownika! Zobaczymy jego krwawe zwycięstwo nad orkami w Bitwie o Czerwone Szczyty!",
[1047519062]="Nie mogę wystarczająco podkreślić, jak ważne jest, byś zabił tych czarowników i zdjął tę osłonę, $n.",
