[1047729154]="Przekażę wam słowa mojego loa. Tak powiedział do swych wyznawców:",
[1047730825]="To doniosły dzień, moi przyjaciele. Zanim Legion nie przybył, żaden cudzoziemiec, nie był wpuszczany w korytarze Nightholdu, przez dziesięć tysięcy lat.",
[1047792882]="Straże! Tutaj!",
[1047887349]="Ta księga zawiera czar, który przeniesie cię do biblioteki. Ruszaj. I przygotuj się na wszystko!",
