[1047935978]="Och, przestań narzekać i złap za kij!",
[1048369664]="Tak... nic mi nie będzie.",
[1048485050]="Byliśmy pod zbyt ciężkim ostrzałem, więc wycofałam swoich ludzi. Gdyby jednak mogli się tam szybko dostać, moglibyśmy zaatakować te statki harpunami.",
[1048834256]="Naliczyłam sześciu... nie, siedmiu strżników patrolujących niebo.",
[1048837649]="Tichar! Gdzie twoje maniery!",
[1048928287]="Nagi stanowią ciągłe zagrożenie dla naszych wysiłków. Opanowaliśmy jednego z ich brutali, aby go użyć przeciwko nim. Poprowadź go do bitwy z nagami!",
[1048951950]="W rzeczy samej, Pierwsza Wtajemniczona.",
[1048968700]="Stormwind wiele wycierpiał z rąk tych, którzy ulegli podszeptom cieni. Jeśli jednak są inni, którzy potrafią władać ich mocą, byliby wspaniałymi sojusznikami.",
[1048988411]="Redridge się pozbiera, ale orki pewnie nie...",
[1049225240]="Teraz już dam radę ich powstrzymywać, orku. Spotkamy się w Sanktuarium Malorna.",
[1049243919]="Kolejna porażka! Opanujcie tą bestię, zanim się uwolni!",
[1049263564]="Czekałam na ten moment prze wiele lat. Illidan i jego sługusy zostaną zniszczeni!",
[1049321795]="Giń, ziemiołazie!",
[1049396926]="Ruszamy!",
[1049559756]="Jak mogę usprawiedliwić zabawy konne z kopiami, kiedy tam umierają ludzie bez mojej ochrony?",
