[1050180237]="Nigdy wcześniej ich nie spotkałem. Pandareni nie przybywają jednak ze złymi zamiarami.",
[1050224682]="Śmierć... nareszcie... twoje zadanie... powstrzymaj G'huuna...",
[1050252618]="Szef Bazzelflange znajdujący się na arenie to podróbka! Zdemaskujmy ich i sprawdźmy co się tam dzieje!",
[1050311047]="Niezła broń, rycerzu śmierci. Jeśli chcesz pomóc, porozmawiaj z Jacem i Allari.",
[1050395545]="Arcydruidzie $n, musimy iść. I TO JUŻ!",
[1050449625]="Jego córka nie zrobiła nic.",
[1050502430]="Jak udało ci się... to... rozwiązać...",
[1050583234]="Nie mamy wyboru! Musimy ostrzec inne wioski o tym, co się tutaj dzieje!",
[1050644808]="Lordzie Śmierci $n, musimy iść. JUŻ!",
[1050765277]="Proszę, nie oddalaj się zbytnio. Potrzebujemy cię tutaj, czempionie.",
[1050822822]="Tak, zdobądźmy ten klucz... ale uważaj na siebie. To miejsce roi się od demonów.",
