[1051915702]="Shandris, chcę żebyś patrolowała plaże i upewniła się, że nikt żywy nie ucieknie. Falstad dołączy do ciebie, jak tylko nas zaniesie na okręt.",
[1052128061]="Śśśśśmierć wrogom!",
[1052158522]="Zapewniam cię, że $n jest najlepszym wojownikiem, jakiego widziałem. Pomoże wam lepiej przygotować wioskę.",
[1052256214]="Ona może nie przeżyć. Jej rany są bardzo poważne.",
[1052342769]="Zwiększono skuteczność pułapek.",
[1052466201]="Ach, dobrze, widzę, że nie łatwo cię rozproszyć. My, pandareni, jesteśmy maksymalnie skupieni na danej chwili, czasem na naszą.",
[1052485417]="Trzeba... rozszerzać się...",
[1052563173]="Bądźcie czujni żołnierze!",
[1052634557]="Dobra robota. Zdobyłeś nam wystarczającą ilość czasu, aby zająć się tamtym sterowcem i jego tchórzliwymi bombami. Zniszcz go.",
