[1052875718]="Jak całkowicie przewidywalne! Wiedziałam, że przyjdziecie.",
[1053008382]="Jesteśmy z tobą!",
[1053356722]="Dzięki ostremu jak brzytwa umysłowi, od razu wiedziałam, jak zgładzić tą bestię.",
