[1054177436]="%s wpada w szał!",
[1054302311]="Dobrze słyszałam, Omnuron? Dołączamy do walki?",
[1054384167]="To... nie jest możliwe! Moim... Moim przeznaczeniem było zwycięstwo...",
[1054409469]="Czy rozmawiałeś z kimś, kto nie zachorował?",
[1054415462]="Lok-tar! Idziemy!",
[1054669185]="Kim jesteście?",
[1054753777]="Ich wiedza druidyczna jest starożytna i niezrównana. Przeciągnięcie ich siły na naszą stronę jest niezbędne, jeśli mamy powstrzymać Legion.",
