[1055849210]="Spacerkiem, co... ?",
[1056193358]="Jesteśmy twoimi dłużnikami przyjacielu. Porozmawiaj z Lysandrem na Vengeance Landing; zaaranżuje dla ciebie odpowiednią nagrodę.",
[1056320913]="Koncert Tauren Chieftains rozpocznie się za trzydzieści minut!",
[1056428767]="Prawie straciłem nadzieję.",
[1056602069]="Nikt nie może się z nami mierzyć!",
[1056668513]="Hę? Gdzie jest mój portfel? Czekaj! Czy ten smarkacz właśnie ukradł mi portfel?! Za nim!",
[1056704222]="Na siłę... co... to jest?",
[1056781151]="Ten nicpoń dowodzi strażnikami w tym więzieniu. Musi odpowiedzieć za swoje zbrodnie!",
[1056848179]="Będę musiał przeanalizować wszystko, czego się tu dowiedzieliśmy, $n.",
[1057199245]="Nasza siła pochodzi ze współpracy.",
