[1165382339]="Słowa Thralla mówią prawdę. Zawsze tak było. Horda jest czymś o wiele większym, niż zgrają starych upartych przywódców i bohaterów z Northrendu. Ludzie wykrzykują imię Garrosha... przynajmniej na razie.",
