[1423671936]="Paladyni Srebrnej Dłoni!  Wystąpcie i zaprezentujcie się do bitwy!",
[1423786108]="%o |TInterface\\Icons\\INV_Sword_2H_DraenorQuest_B_01.blp:20|t Blightguard Captain Thedric ściga $n serią uderzeń |cFFFF0000|Hspell:286805|h[Blighted Edge]|h|r !",
