[1431566678]="Tak jest, Mroczna Pani.",
[1431664230]="Z przyjemnością złamię cię.",
[1431815239]="$n! Chcesz się przyłączyć do zabawy?",
[1431859310]="Jak mnie pokonaliście?",
[1431861544]="Straciliśmy inżynierów, to się nie skończy dobrze!",
[1431863692]="Dajcie nam surowe... i jeszcze żywe!",
