[1432448307]="Nie wiem co mnie naszło.",
[1432591473]="Niegdyś żywioły do mnie przemawiały... a teraz słyszę jedynie szepty. Czy to jest nasze przeznaczenie, czy jedynie ostrzeżenie?",
