[1433274245]="Niech księżyc cię prowadzi.",
[1433416511]="Jak sam pewnie zauważyłeś, pojawili się tu niechciani goście. Ta groteskowa istota zaczęła wypluwać z siebie masę problematycznych istot, z którymi musimy się uporać. Powodzenia i niech Światłość będzie z tobą.",
