[1675975216]="Ponure wieści, mój niewysoki towarzyszu. Jeśli poniesiemy tu porażkę, konsekwencje zostaną zauważone na całym zamarzniętym pustkowiu. Lord Fordragon i nasze armie przy Bramie Gniewu będą bezbronne w natarciu z Naxxramas.",
