[1690294264]="Honor nie ma znaczenia dla martwych. Wojownik w imię honoru może rzucić się w wir walki, ale wódz musi myśleć o wielu innych aspektach. Zrobimy, jak mówi Mędrczyni Aeire i nadal będziemy chronić naszą wioskę.",
