[1755465462]="Mimo to, wciąż liczę, że pewnego dnia Thrall powróci. Póki co przyszłość rysuje się w ciemnych barwach... i bardzo krwawych.",
[1755522581]="Otrzymałam informację o zagrożeniu w pobliżu. Wyeliminuj je, tak szybko jak to możliwe!",
[1755634873]="Nawet ich przywódca wycofuje się z pola bitwy.",
[1755784037]="Argus... powstanie...",
[1755820972]="Trzymaj się mocno mych gałęzi, wojowniku.",
[1755914173]="CZEKAJCIE!",
[1755946409]="Och, Uriah, jesteś ranny!",
[1756009668]="Żyłam tutaj i utrzymywałam tę świątynię z błogosławieństwem Alexstraszy dłużej, niż pamiętam. W jej najmroczniejszej godzinie, zawiodłam... Poległam u stóp tego przeklętego rycerza śmierci... Bloodbane'a.",
[1756176774]="Kto, jeśli nie sami tytani, mógłby rzucić taką klątwę? Co mogłoby mieć taką moc?",
[1756292911]="Nasz sługus ork, przygotowuje w tej chwili portale do serca Auchindoun. Pochłoniemy ich dusze i zaatakujemy tym, czym dysponujemy.",
[1756319474]="Starożytna magia chroni Dreamgrove. Tutaj, wszystkie dzikie stworzenia znajdą azyl.",
[1756407307]="Ashvane chce utrzymać nas na dystans. Ale wyczuwam w pobliżu źródła magii, które zasilają to pomieszczenie.",
[1756431727]="Będziemy razem pracować, by zniszczyć Legion od środka.",
[1756674768]="Jesteś najlepszym przyjacielem, jakiego Orkus kiedykolwiek miał, $n. *Orkus kaszle*",
[1756759177]="Na masę perłową, chcę cię.",
[1756853480]="Żegnaj, przyjacielu. Muszę wracać do Twierdzy Wojennej Pieśni.",
[1757000008]="Niebieski... niebieski.... niebieeeeeski!",
[1757046172]="Mówiło się, że Elisande posiadła zaklęcia znane tylko brązowym smokom. Być może one zechcą pomóc w twoim zadaniu.",
[1757150385]="Nie można pozwolić takiej bezwstydnej nikczemności zakwitnąć w naszym świecie.",
[1757154595]="Ashvane włada tym miastem!",
[1757218895]="Zakładam, że przyczółek został już założony?",
[1757304205]="Skoordynujcie ataki, ja odwrócę jego uwagę.",
[1757320087]="Wycofują się.",
[1757336931]="Przybyszu, twoje wyzwanie zostało wysłuchane. Ordonie, zajmij ten teren w imieniu Płonącego Boga!",
[1757407584]="A jednak jestem pewna, że jesteśmy obserwowani...",
[1757424431]="Widziałeś to? Prawie pozbawił mnie głowy!",
[1757496926]="Przysięgałeś bronić tego królestwa. Jeśli nie spełnisz tego obowiązku, znajdę kogoś kto to zrobi.",
[1757557714]="Złamanie go było wyczerpujące. Okrucieństwa, których dopuściłem się na jego duszy. Opierał się tak długo, ale wkrótce pokłoni się przed swoim królem.",
[1757579219]="Pan Mortuus będzie taki zły! Ja iść już do domu.",
[1757650722]="Czujecie to? Świeże mięso w jakiś sposób przedarło się do naszej cytadeli. Rozglądajcie się za intruzami.",
[1757770850]="Nie w taki sposób...",
[1757843377]="Śmierć to jedyna litość, którą oferuje Zem'lan. I nawet tego większości odmawia.",
[1757974901]="Jak się będziemy tak guzdrać, nigdy nie dostaniemy kasę za tę robotę. Ruchy!",
[1758086491]="Nie! Nikt nie zawładnie moją mocą!",
[1758101743]="Wezmę bezpieczniki, zapasowe pakiety rakietowe i azeryt.",
[1758132729]="Dobra robota. Domyślam się, że nieco się ode mnie nauczyłeś.",
[1758202654]="Ich atak wkrótce osłabnie. Nie poddawajcie się!",
