[1758589054]="Nie... wybraliśmy swego losu...",
[1758804628]="Sprzeciw jest beznadziejny...",
[1758821896]="Wszyscy umrą, kiedy się przebudzę!",
[1758923128]="Jeszcze raz spróbujmy Autożyro Atak!",
[1758950922]="Kajdany słabną...",
[1758998789]="A więc dajmy im nauczkę, dobrze?",
[1759006430]="Nikt nie będzie tęsknić za Gul'danem... ani tu, ani w żadnej innej ścieżce czasu.",
[1759063831]="Tak, milordzie.",
[1759201723]="Ahoj, kapitanie.",
[1759244644]="Tak jest, koleś. Mam o czym opowiadać!",
[1759426381]="Jeden z geomancerów Navarrogga zamyka tunele by powstrzymać napływ nieprzyjaciół z Legionu. Broń go za wszelką cenę!",
