[1760037878]="Jak wiecie, epicka zbroja jest ZAWSZE purpurowa. Owińcie się dolnym kolorem tęczy!",
[1760098545]="Loa przepowiedziały twoje zwycięstwo. Dobrze wiedzieć, że się nie pomyliły.",
