[1760207785]="AAA! PRZEPRASZAĆ! OBIECAĆ!",
[1760283835]="Psst, hej, mam tu trochę talizmanów. Nie chcesz chyba stawić czoła Legionowi bez odrobiny szczęścia po swojej stronie, prawda?",
