[1761603835]="Nieźle walczysz... jak na krwawego elfa...",
[1761634088]="Słuchajcie, słuchajcie! Wznieśmy toast za odważnego <czka> bohatera, który uratuje nas wszystkich!",
[1761657319]="Mroczne portale rozdzierają rzeczywistość, umożliwiając cienistej magii przenikanie do naszego świata. Zakończcie to, bohaterowie!",
[1761711015]="Niech ktoś się nim zajmie! I przyniesie mi masło kakaowe na balkon!",
