[1762640899]="Nie! Wiązanie... nie mogę kontrolować...",
[1762644752]="Za Wodza Wojennego! Prowadź, pójdę za tobą.",
[1762967327]="Nazwaliśmy tą bestię Dakarr. Było to niegdyś szlachetne stworzenie, przywiedzione do szaleństwa przez obłąkanego vrykulskiego mistyka. Dorro przegnał je, a potem tropił aż do Stormheim. Już nie wrócił, a Talonclawa nigdy więcej nie widziano.",
