[1764149009]="Nie wolno ci ingerować!",
[1764287579]="Nareszcie, jakaś godna walka!",
[1764576980]="Od tej chwili... nie powiem ani słowa.",
[1764760496]="Podejdź, $n. Przekonaj się, co przynosi ze sobą Koszmar...",
[1764836421]="Splintertree...",
[1764907181]="Nigdy... nie wydostaniecie się stąd... żywi.",
[1764995649]="Przychodzisz, by pomóc rychło w czas, $n. A teraz, pokonaj te aberracje!",
