[1765162335]="Przestań mnie dźgać!",
[1765251158]="Przebrzydłe nożycowce roznoszą to miejsce w gruz!",
[1765266291]="Ja uszkodzę ich działa na górnym poziomie, a ty spal je w wąwozie. Spotkajmy się przy zagrodach dla zwierząt, kiedy już skończysz.",
[1765613668]="Moja praca... nie została... skończona...",
[1765881156]="Ona chce dalej nauczać mnie swoją zdradziecką teorią? Dobrze. Chodźmy.",
[1766028514]="Nikt nie może się zbliżyć!",
[1766075057]="Poddajcie się szaleństwu!",
[1766192809]="Podejdź bliżej, nie gryzę.",
[1766244311]="Panem tego zamku! Będziesz moim gościem na obiedzie!",
[1766489420]="Skany Starszego Ironbrancha wykryły mechanizmy unieruchamiania oparte na roślinach.",
[1766985647]="Nasza potęga cię zgniecie!",
[1766993329]="Dobrze was znów widzieć, przyjaciele. Kiedy nie mogłem was znaleźć po zniszczeniu Draenoru, nie byłem pewny, co mam myśleć.",
[1767065360]="Ciii! Wystraszysz ryby.",
[1767194695]="Widzę moim okiem szpiega... futrzanego przyjaciela do przytulania!",
