[1768003778]="Odłóżcie broń. To musi być posłaniec, którego obiecał nam prorok draeneiów.",
[1768022982]="Moje połączenie ze Szmaragdowym Snem daje mi wielką moc... ale czyni mnie wrażliwym na ciemność szczeliny. Zajrzałem w jej wnętrze i wiem, że to prawda. Gdybym wszedł do niej, byłbym stracony... zupełnie jak Cenarius.",
