[1768294430]="Zimowy Dziadek jest tylko o lot wiwerną stąd, w Orgrimmarze.",
[1768442703]="Horda zostanie... pokonana...",
[1768565566]="Tylko poczekaj...",
[1768881614]="Te więzienia mają zostać natychmiast zapełnione, albo Malygos dowie się o waszej niekompetencji!",
[1768964420]="Czempionie! Dobrze, że do nas dołączyłeś! Będę odpierał tych Władców Grzmotu na wypadek, gdyby przybyli jacyś twoi sojusznicy.",
[1769643941]="Nadchodzi kolejny elekk!",
[1769660762]="Teraz mogę spać spokojniej, wiedząc, że te okropne istoty już nie grasują w nocy.",
