[1770547184]="Tylko jeszcze... jeden... drink...",
[1770621452]="Ocaliłeś mnie przed niechybną śmiercią.",
[1770852142]="Jesteś w błędzie, upiorzyco. Przyszliśmy po Gidwina.",
