[1774087312]="Ile to już będzie u ciebie kampanii przeciw Hordzie, Wyrmbane?",
[1774128723]="Nie, nie, Joma. Ten się nie nadaje. On jest zbyt... uch... niespokojny. Tak! Niespokojny! Podejrzewam, że spłoszyłby się na każdy gwałtowny ruch.",
