[1776185327]="Jeźdźcy Lodowych Grzyw! Bij na alarm!",
[1776381127]="Doszłam do wniosku, że droga, którą podążaliśmy była błędna. Zostaliśmy zdradzeni przez człowieka, którego nazywaliśmy księciem. W swojej żądzy mocy, wysłał spaczonych, żeby nas zaatakowali i zabrali M'uru do Słonecznej Studni.",
[1776402825]="Powstań, Wielka Inkwizytorko! Twój Lord Śmierci wzywa cię ponownie na ten świat!",
