[1777016592]="Dlaczego spadam?!",
[1777064709]="Ten kamień nie może zostać rozbity!",
[1777094179]="Ja... uch... zdaję się, że wskażę sobie drogę do wyjścia...",
[1777131764]="Król Grzmotów tego pragnie; tak się stanie.",
[1777155709]="Wydrę tajemnice z twego ciała!",
