[1777533320]="Po zrobieniu wyłomu ból stał się... znośny. Po prostu... dajcie mi chwilę.",
[1777563856]="A jeśli chodzi o ciebie, orku. Udowodniłeś, że życie cenisz bardziej niż dobytek, a ja nagrodzę takie poszanowanie. Możesz zabrać też kowadło.",
