[1780648945]="Myślę, że nie ma na co czekać! To albo wszystko naprawi... albo nas zniszczy. Potrzebuję, żebyś nacisnął ten wielki czerwony guzik opisany 'NIE NACISKAĆ TEGO GUZIKA'.",
