[1781049932]="Wciśnij to tu...",
[1781080312]="Myślałam... Myślałam, że... nie żyjesz.",
[1781286405]="Jeszcze jedna porażka, Melandrus. Uznaj, że to szansa na ich naprawienie. Rozpraw się z tymi przybyszami. Ja muszę wrócić do Nighthold.",
