[1783523255]="Och, ale będzie ubaw...",
[1783605230]="Każdy strzał zabójczy.",
[1783723177]="Coś... ugryzło mnie w głowę, tak myślę.",
[1784003173]="Modlę się, żeby nie było za późno, $n. Pędź ile sił w nogach. Znajdź moją córkę.",
