[1784790025]="Szybko, $n, rozbij następny kamień dusz.",
[1784830337]="Bracia w chaosie, nadszedł Zmierzch! (Cienie wydłużają się, noc się nie kończy.) Deathwing rozerwał ten świat. (Drzwi, które raz otworzono, nigdy nie można zamknąć.) A więc to prawda, że Władcy mogą wrócić. (Mistrz nadchodzi, nadchodzi, nadchodzi.)",
