[1793059291]="Do usług.",
[1793068346]="Sprawiedliwości stanie się zadość.",
[1793096401]="Może jest bohaterem zza mgieł, który nas ocali?",
[1793097999]="Wyślijcie zgniatacza!",
[1793102269]="Oczyszczę każde skażenie, jakie zdołam; mój ogień ciebie nie zrani.",
