[1904082618]="Za tobą, Muradinie!",
[1904099026]="Prawie skończyliśmy!",
[1904288549]="Możemy użyć mocy Pustki, aby ukryć magię Lady Jainy, którą użyje ona do otwarcia portalu. Wierzymy, że wyeliminowaliśmy jakiekolwiek... efekty uboczne.",
