[1905141010]="Ups!",
[1905163405]="Więc... co z twoim azerytem?",
[1905184409]="Część wrogów zyskuje większość swej siły z broni którą władają. A ja? Ja wolę zarówno wielką broń, jak i aplikowanie śmiercionośnych trucizn moim wrogom.",
