[2055227225]="Ładunki wybuchowe eksplodują za 2 sekundy...",
[2055240853]="Naszymi dzisiejszymi awanturnikami będzie grupa dziobatych pingwinów z polarnego urwiska Northerendu. Strzeżcie się Śliskiego Popłochu!",
