[2055545394]="Ludzie Suramaru zawdzięczają tym bohaterom dług, którego nigdy w całości nie spłacimy. Zostanę z nimi do samego końca.",
[2055609856]="Nie... To nie może się...tak skończyć...To co... To co widziałem...",
[2055710602]="Za późno... on wie... że król... tu jest...",
[2055741215]="Banda manowych narkomanów, ha hah! Nie to co ja. Moja siła woli jest ze stali.",
[2055755055]="Jeśli kiedyś jeszcze trafisz znów do tej jaskini, nie zapomnij o prądach termicznych. Mogą pomóc ci uciec w ciężkich sytuacjach.",
[2055826626]="Możesz przes...",
[2055916003]="Alpaka! Jej!",
[2055975595]="To by się nie stało, gdyby twój zad nie był tak... <ummm>... OBFITY.",
[2056334989]="Twoje serce... ogniste sny...",
[2056362853]="Wrócę do Archiwum, aby sprawdzić, czy uda mi się zablokować sygnał. Być może uda mi się zdobyć nam trochę czasu, kiedy będziecie się nim zajmować.",
