[2056671171]="Mam szczęście, że żyję!",
[2056692588]="Jest źle, jeśli weźmiesz pod uwagę, że jego trasa przebiega w zasięgu wzroku naszej placówki w Xibali.",
[2056713996]="Przed nami znajduje się droga do Telaar. Gdy dojdziemy do rozwidlenia, rozdzielimy się, gdyż na pewno poślą po nas posiłki. Jeśli szczęście dopisze, jedno z nas dotrze do Telaar żywe.",
