[2059159401]="Miłej zabawy z klejnotem! Wydaje mi się, że rytuał... prawie go nie uszkodził.",
[2059241038]="Dziękuję ci, $r! Jestem pewny, że mój ojciec hojnie się wynagrodzi! Na razie!",
[2059300412]="Bank jest silnie strzeżony w dzień i w nocy. Tu możesz trzymać swe kosztowności.",
