[2060350985]="Jak dużo części mają?",
[2060468209]="Flota... będzie jej...",
[2060535301]="Zniszczę waszą odwagę!",
[2061087482]="Ho, ho! Zobaczcie co kot domowy przytargał! Niewiarygodne!",
[2061358921]="Niegdyś były tu tylko murloki, potem przyszła burza, a po niej nagi wyroiły się na brzegu. Wzięły mnie jako pierwszego i nieco się tego wstydzę.",
