[2061770905]="Mówisz prawdę, bracie!",
[2061825867]="Odpływam... ku zachodowi słońca...",
[2061825990]="Gotowi do akcji, trzymajcie te krasnoludy z dala od nas!",
[2061840479]="%s uśmiecha się.",
[2061847261]="Po prostu wydawało mi się dziwne, że góry mają płetwy!",
[2062086342]="Maszyna się zacięła. Musimy sprawić, żeby te koła zębate zaczęły się obracać!",
[2062155211]="Mechazod jest szalony! Musisz go powstrzymać, zanim będzie za późno!",
[2062205800]="Mroczna Włócznia to głupcy. Nikt nie stanie nam na drodze.",
[2062288736]="Zwycięzcy już ją zabrali, Skovald, jak mieli do tego prawo. Twój protest jest spóźniony.",
[2062426030]="Kto jest mądrą dziewczynką?",
[2062434472]="Duchy... prowadźcie mnie.",
[2062494954]="Dobrze ich przygotuj, Raeloraszu. Moc Malygosa nie może się równać z niczym, co do tej pory widzieli. Pewnie go tylko opóźnimy dzięki tej dywersji.",
[2062519410]="Dziękuję, bohaterowie. Przywróciliście nadzieję ludziom Kul Tiranu.",
[2062535420]="Dlaczego zbierasz szkodniki do pudeka?",
[2062581460]="A oto nasz następny zawodnik. Powitajcie $n! $r $c Czwartej Rangi!",
[2062791999]="Dziękuję, Wielki Egzarcho. Świetliści żołnierze z pewnością wzmocnią nasze szeregi.",
[2062814004]="Haha! Nie mówiłam tego dosłownie.",
[2062821605]="Fiu! To maleństwo wie, jak się ruszać. Wyobraź sobie, co zrobi z Aluchami!",
