[2062913317]="Tak jest, wasza wysokość!",
[2063019683]="Poproszę Elune. Plamy Koszmaru nie można usunąć... ale być może uda się ją zatrzymać.",
[2063093652]="Tutaj!",
[2063153099]="Witamy na Festynie Mrocznego Księżyca, czarnoksiężniku!",
[2063173586]="Jak ta broń ma leczyć rannych?",
[2063339804]="NIECZYŚCI NIE MOGĄ WEJŚĆ DO KOMNAT UMARŁYCH.",
[2063360662]="Posłuchaj, Lagnus, uważam cię za zdolnego człowieka, ale moja cierpliwość jest cienka. Wiem, że Muradin jest tutaj, czy możesz wskazać mi go, czy nie?",
[2063375581]="Niechaj spłynie na was śmierć!",
[2063462034]="Nadjeżdża pomoc drogowa. Widzisz, właśnie o tym mówię - szybka, a do tego uśmiechnięta obsługa!",
[2063564711]="Dobrze cię znów widzieć, $n. Pójdę zobaczyć, kto jeszcze potrzebuje pomocy!",
[2063821145]="W ruinach Zin-Azshari musi znajdować się coś, co pomoże nam dotrzeć do Kamienia Pływów. Powodzenia.",
[2063888445]="Przepraszam, że kazałem ci czekać, cukiereczku. Wiem, jak się martwisz. Prawda jest taka, że ten tutaj nieznajomy ocalił moją starą skórę. Pomyślałby kto.",
