[2064319142]="Terokk was nie ochroni!",
[2064457244]="Ho! Jakie zęzolizy śmią mnie wyzywać?",
[2064647465]="Ach, Hir'eek, loa nietoperzy... musi być gdzieś w Nazmirze. Ten przebiegły loa będzie wiedział jak ich powstrzymać.",
[2064671334]="Witaj przy mym ogniu, podróżniku. Wiem wiele o Ner'zhulu, ale ostatnio zupełnie go nie poznaję.",
[2064783260]="Jej siłą płynie moimi żyłami!",
[2064801599]="Okani wierzy, że poradzę sobie z największymi zagrożeniami dla plemienia. Jestem zaszczycony z tego powodu.",
[2064802361]="Dziękuję ci, paladynie.",
[2064881517]="Dziękuję wam obojgu. Wasze wsparcie wiele dla mnie znaczy... i dla wszystkich Zandalari.",
[2064954187]="Bitwy zwierzaków! Tu, na Ringu Chwały!",
[2064976670]="Dość tych nieznośnych pukawek. Niech postrzelają do tego!",
[2065002242]="Proszę, dość.",
[2065024565]="Otrzep się z kurzu, $n. Król Mechagon z pewnością będzie chciał osobiście z nami porozmawiać.",
[2065399433]="Nie. Ci ludzie nie są twoi. Nie są straceni.",
[2065438642]="Witaj w domu, córko. Widzę, że przyprowadziłaś gości.",
[2065441307]="Dziękować, śmieszny ogrze!",
[2065589714]="Przykro mi, paladynie. Zużyliśmy już całe zapasy wodorostów. Wszyscy są zbyt chorzy, aby udać się do wody, by je zbierać. Przekaż Theroldowi moje przeprosiny.",
[2065594015]="Masz całkowitą rację, $n. Samaara i pozostali liczą na nas. To dla nich muszę przetrwać!",
[2065654679]="Słuchaj. Sprawa wygląda tak. Zabawki, światełka i wiechcie świątecznych ziółek SAME się nie zrobią, wiesz? PROSZĘ więc, SKOŃCZ już z tym przywoływaniem.",
[2065732552]="Tu jesteś, Darionie! Zastanawiałem się, kiedy w końcu wypełzniesz ze swojej nory!",
[2065993818]="Ale zanim się poddam i zmierzę z osądem Światłości, jest jeszcze jedno, co muszę zrobić.",
[2066200056]="Poziom zasilania... spada... uwaga... uwaga...",
[2066222380]="Pracujcie mocniej robole, albo przyjdę tam i was stłukę!",
[2066243872]="Nie zwlekaj, śmiertelniku. Czuję jak esencja życiowa waszych armii zanika. Później będzie czas na żale...",
[2066356881]="Boralus nie upadnie!",
[2066386722]="Gdzie są piraci, zazwyczaj jest i złoto!",
[2066448850]="Pfah! Możesz udławić się swoją srogą karą, Turalyon!",
[2066599536]="Przysięgam, że odzyskamy Teldrassil, zanim skończy się wojna. Ale stoimy w obliczu kurczących się zapasów i rosnącej liczby ofiar. Jeśli mógłbym prosić o jeszcze odrobinę więcej cierpliwości--",
[2066684293]="Mam nadzieję, że jesteś przygotowany na to, by nakarmić moje zwierzaki swoimi.",
[2066763592]="Spotkajmy się w Scholazar Basin w Northerendzie. Razem sprawdzimy ci się dzieje!",
[2066777336]="Zasoby Dalaran są do Twojej dyspozycji. Stąd bohaterowie Przymierza i Hordy będą wyruszać by poszukiwać swoich relikwi!",
[2066830090]="Dobrze, $n. On jest już tutaj. Za mną!",
[2066866803]="Widziałem jak jeden Demoniczny Strażnik zabije setkę elfów. Idźcie ostrożnie.",
[2066956426]="Wystarczy, że zdepczesz te małe chwaściki. Nie ma sensu, żebyś marnował czas wyrywając je.",
[2067002952]="Strzelby, strzelby, strzelby! Dalej ziomki!",
[2067328899]="Spotkajmy się na Polanie Zmierzchu, czempionie. Mamy wiele do zrobienia.",
[2067365066]="Azshara zajmuje te ziemie!",
[2067375215]="Światłość jest moim przewodnikiem... Światłość jest moim pożywieniem!",
[2067493581]="THRYM MIAŻDŻYĆ!",
[2067583619]="To wasze twarze będę widzieć w moich ostatnich świadomych chwilach. Ostatnie wspomnienie agonii, zanim zamienię się w popiół i odejdę w niepamięć. Przyjmuję to z zadowoleniem...",
[2067599028]="Ja słyszeć, że dużo się dziać.  My zabijać gronny już?",
[2067757682]="Och, cudzoziemiec... Komendant prosił, żebyś się z nim zobaczył, zanim wybierzesz się do obozu.",
[2067818948]="Te spaczone totemy są całkiem smaczne, kiedy już wydobędzie się je z chrupiącej skorupki.",
[2067949129]="Jak tu cicho...",
[2068099639]="Twoje życie słabnie.  Pozwól, że ci pomogę.",
[2068122198]="Jest tak wiele różnych loa! Jak tu wybrać tego jedynego, by za nim podążać?",
[2068147954]="Mam nadzieję, że lubisz krwawiące nosy!",
