[2554549525]="Wspaniale. Idę przygotować publiczność. Powodzenia!",
[2554571072]="Nie ma dla was nadziei. Wasz Darkshore obrócił się w ruinę. Astranaar upadnie zanim zapadnie noc, i to miejsce też. Wycofajcie się do Darnassus, póki czas.",
