[3148535161]="Legion za to zapłaci!",
[3148618922]="Uważasz, że demony będą działały uczciwie? Te bestie są brutalniejsze niż orki i sprytniejsze niż nieumarli. Nie próbuj walczyć z Legionem, jak z normalnym przeciwnikiem.",
