[3149012225]="Pokażcie się!",
[3149056278]="To wszystko... moja wina...",
[3149119196]="Dziękuję za to, że mnie uratowałeś, Zrodzony z Nocy. Nigdy nie będę służył komuś, kto okazuje takie okrucieństwo własnemu ludowi!",
