[3149986626]="Moje życie dla... boga śmierci!",
[3149989134]="Ej, nieumarły... Chcesz coś kupić?",
[3150025578]="Przeżyj lub zgiń, nasz czas nadszedł.",
[3150090961]="Zawsze ucieleśniałaś to, co najlepsze w Azeroth, Tyrande. Swoją wiarą. Swoim oddaniem. W najmroczniejszych czasach, moja wiara w ciebie nigdy się nie zachwiała.",
