[3150761269]="Cóż uczyniliśmy?!",
[3150834593]="Przymierze jest silne!",
[3150848531]="Arcymag Khadgar? Wojownik? Niespodziewana wizyta.",
[3150869940]="Ooch, potrzeba prawdziwej odwagi, by wyzwać Panią Iluzji. No więc? Pokażcie, na co was stać!",
[3150879860]="Pierwsza część jest najtrudniejsza. Kiedy dotrzemy to prądów termicznych będzie nam znacznie łatwiej.",
