[3150991110]="Szczegóły, szczegóły.",
[3151013160]="Zapewnijcie dopływ surowców!",
[3151048739]="Co inspiruje cię do walki? Mnie ekscytuje pokonanie potężnego przeciwnika.",
[3151115133]="Te mechaniczne skafandry nie są tanie, $n. Wyślę ci rachunek za ten egzemplarz!",
[3151132805]="Ahhh, te są po prostu idealne!",
