[3151874255]="Haaa-ha! Łapcie to, wy zęzolizy!",
[3152016209]="ŚWIATŁOŚCI, DAJ MI OSTATNI RAZ MOC! DAJ MI SIŁĘ... ROZBIĆ TE WIĘZY!",
