[3154962100]="Myśląc, że po prostu mnie wygna, wybrałem pozostanie w lesie. Zamiast tego... wydarł z ciała moja duszę, zostawiając jednak wątłe połączenia, tak, abym nie mógł zbyt daleko się od niego oddalić.",
