[3156952775]="Dorze, proszę, dołącz do nas na arenie.",
[3156990613]="Ta kraina roi się od wrogów! Musimy ich powstrzymać!",
[3157051811]="Zielona pięść imperium trolli uderzy w tę krainę i sprawi, że znów będzie ona należeć do nas.",
