[3163301612]="Moja żona twierdzi, że rawazaury mogą jeść wszystko, co im się podoba! Jeśli to prawda, to nabłonek ich żołądków musi być jak z żelaza! Zbierz go trochę la mnie... zanim ona zauważy.",
