[3164159545]="Ach, jeszcze jedna dusza do zniewolenia przez G'huuna!",
[3164240777]="Dziękuję ci z całego serca - w zamian możesz wziąć coś z mojej osobistej skrzynki. Muszę teraz odjechać, ale zapewniam cię, to była świetna robota!",
[3164365249]="Zakończ to, Whalebelly!",
