[3168851354]="Miałam wizje, kiedy szukaliśmy cię w Thros. Momenty zwątpienia i bólu. Nie chciałabym rozdrapywać starych ran, ale... muszę wiedzieć. Czy już ci... lepiej?",
[3168864749]="Och nie, ten wózek wygląda na niestabilny... zaraz wybuchnie!!!",
