[3169092784]="Musimy iść i zebrać się z innymi uczniami. Mamy dużo pracy, zanim będę mógł podjąć następną próbę przywrócenia Pustkowia. Żegnajcie, dzielne dusze!",
[3169229232]="Lordzie Falconcreście, wszystko toczy się zgodnie z planem. Zapewniam, że to wyłącznie kwestia czasu.",
