[3383944043]="Coś jest nie tak.",
[3384077331]="Leorajh używa kamienia słonecznego, żeby pomóc klanowi.",
[3384085674]="Dobrze, że z nami znowu jesteś, Hati staruszku. Nie zapomnij o nas!",
[3384093046]="Wkroczyłeś na poświęconą ziemię.",
[3384142493]="Świeży chleb, upieczony dziś rano.",
[3384250544]="Iluzoryczna Banshee! Zabij ją, zanim zawyje!",
[3384252980]="Nie mam pojęcia. Ale świetnie mu w tym idzie!",
[3384440722]="Miny zostały zniszczone, nasz wróg jest osłabiony, a śmiercionośna maszyna gotowa. Pokażmy Aluchom naszą potęgę!",
[3384607141]="Nie wspominając już o tym, że pewnie będziemy musieli się zmierzyć ze starym Gezzrokiem, zanim uda nam się zabrać kawałek rdzenia.",
[3384637086]="Wielkie dzięki!",
[3384705040]="Nieunikniony cykl, tak pewny jak przepastne jest morze!",
[3384732464]="Co masz na myśli mówiąc, że nadszedł mój czas?! Zabiję cię tu i teraz!",
[3384766330]="Na nich! Lok'tar!",
[3384806993]="Potrzebujemy więcej stożkowych muszli. Używamy ich do robienia prawie całego naszego uzbrojenia. Muszle są twardsze od większości metali, ale też i lżejsze.",
[3384841440]="Jaka wyśmienita ironia, że pirat trzyma tak pożądaną nagrodę... jako trofeum.",
[3384878764]="Wygląd może mylić!",
[3384909386]="Ja... ja się nie kontroluję. Związany twoim piekielnym wynalazkiem.",
[3385000280]="Twoje wysiłki nie pozostały niezauważone, $n. Kolejny raz dowiodłeś, że jesteś jednym z najlepszych z nas.",
[3385037052]="Zdolność poruszania się golema mieści się w specyfikacji.",
[3385048990]="Moje życie nic nie znaczy!  Liczy się tylko nasze święte zadanie!",
[3385078891]="%s upada nieprzytomny.",
[3385401397]="Hej!  Czyjaś skrzynia medyczna ucieka!",
[3385596984]="Nie denerwuj się, śmiertelniku. Twoja świadomość została przeniesiona do mojej gwiezdnej formy w Wielkiej Pustce poza Wszechświatem.",
[3385786953]="Dlaczego nie odpuścicie?!",
[3385806577]="Chodź, musimy pójść do Świątyni Białego Tygrysa.",
[3385834206]="Pół kilometra na wschód stąd znajdują się niewielkie wykopaliska Relikwiarza.",
[3385935607]="%o Głębinowy Konik Morski wydaje się być bardzo niezadowolony.",
[3385946078]="Ten wyłom prowadzi do krainy wody. Królestwa Neptulona, Łowcy Fal.",
[3386060788]="Strefa ulegnie zniszczeniu za 3 minuty.",
[3386208264]="Powstrzymam otaczające wody... tak długo, jak będę się dobrze bawić.",
[3386225757]="Loh i Morze. Młody tortollan musi natychmiast odnaleźć drogę w bezpieczne miejsce zaraz po wyłonieniu się z piasków.",
[3386254765]="Jak tak dalej pójdzie, to sam będziesz potrzebował uzdrowiciela. Ranny na niewiele nam się zdasz.",
[3386512803]="$n przygotowuje wystawną suramarską ucztę!",
[3386611369]="Jestem tu z desperacką misją. Szukam dziecka Światłości i Cienia: chłopca, któremu przeznaczone jest zakończyć wiek demonów.",
[3386733078]="Zawodnik został pokonany!",
[3386847023]="Dużo błyskotek. Może lubię cię bardziej niż admirała.",
[3387088258]="Nie pozwólcie przejść tym potworom przez bramę! Stójcie twardo, żołnierze!",
[3387244662]="Nie mówiłam ci, że masz się trzymać z daleka? Ledwo udało nam się wyciągnąć cię w całości!",
[3387293056]="Moje ostrze cię przetnie.",
[3387366150]="Zebraliśmy trochę przedmiotów z tego okresu czasu. Mam nadzieję, że pomogą!",
[3387428450]="A mój ojciec? Co on robi, aby z tym walczyć?",
[3387467402]="Nie pozostanę martwy zbyt długo... Wkrótce się zobaczymy, Jamboya...",
[3387510560]="Już niedaleko...",
[3387672968]="Daj mi wszystkie swoje warzywa!",
[3387808534]="On zabił wszystkich! WSZYSTKICH!",
[3387981672]="Hej, rekrucie.",
[3388029336]="Matko, chcę, byś zmobilizowała naszą piechotę oraz medyków.",
[3388043038]="Nie! Proszę! Ja... Ja mam dzieci! Ja... Ja...",
[3388053291]="Wiedzcie, że jeżeli którykolwiek z was, robole, będzie chciał odpocząć, to cmentarzysko jest tam.",
[3388232902]="%s chochocze.",
[3388257265]="Nareszcie, walka godna oglądania.",
[3388350181]="W okolicy czai się śmiertelny wróg. Zabij go, zanim skrzywdzi naszych sojuszników.",
[3388447254]="Stała się wiedźmą, aby zemścić się na mnie...",
[3388509756]="Tak trzymać. Będziemy mieli wkrótce pełne ładownie.",
[3388616416]="Co się wydarzyło? Czemu armia odchodzi? Sprowadziłem tu wszystkie pterrordaxy!",
[3388620689]="Co robisz? Spadaj!",
[3388624978]="Zprawiarz, że nozne elwy ztają zię nerwowe, Gnombuz!",
[3388771394]="Masz szczęście, że nie wypatroszę cię tak jak stoisz, kmiocie. Jesteś głupi, skoro myślisz, że możesz przemawiać w taki sposób do swojego Wodza Wojennego.",
[3388974436]="Oczywiście, droga siostro.",
[3388987679]="Cerellean! Udało ci się!",
[3389016960]="Frozen Throne...",
[3389043505]="No, no, no... a to co?",
[3389078925]="Przegrywasz!",
[3389115025]="Paval Reethe! Nareszcie cię znaleźliśmy. I do tego teraz dogadujesz się z ogrami? Nie obawiaj się, nawet dezerterzy i zdrajcy zasługują na łaskę.",
[3389257940]="Twoja dusza należy do mnie!",
[3389264590]="Śmierć wkrótce przyjdzie.",
[3389279154]="Poczta musi działać!",
[3389307855]="%s ryczy!",
[3389405724]="KO! Protokół dziobania aktywny!",
[3389436893]="Niesamowite... ale mamy zadanie do wykonania. Zostały dwa loa. Musimy dołączyć do pielgrzymki tortollanów, aby zobaczyć Torga, żółwiowego loa.",
[3389459832]="Wiatry wiejące od lądu, napełnijcie nasze żagle! Wiedźcie nasz statek przez oceany!",
[3389658365]="Tutejsze sokoły są pod wpływem uroku wiedźm. Chciałbym, aby był sposób na ich ocalenie, ale to zaszło zbyt daleko. Te cebule powinny pomóc ci zrobić z nimi porządek!",
[3389752962]="Zajmij się tymi owadami, Beliashu.",
[3389773183]="Widzisz, bracie... nie jesteśmy tacy różni...",
[3389807180]="Będę walczyć u twego boku.",
[3389864563]="Możecie zostać, dopóki Taylor nie poczuje się lepiej. Ale wtedy, musicie odejść.",
[3390075940]="Przynieś mi inne dzieło dotyczące koboldów. Chciałbym zweryfikować tą hipotezę.",
[3390173281]="Jeśli osłonisz nasz odwrót, być może to przeżyjemy.",
[3390286462]="Odczep się, ona jest już zaręczona!",
[3390290434]="Dziękuje ci, Rato. I tobie, $n. Przyszedł czas, aby przemówić do mego ludu.",
[3390376415]="Smakowity szpik. Chrupiące kości.",
[3390439508]="Twoje poświęcenie NIE pójdzie na marne!",
[3390471849]="Oczyścić pokład!",
[3390478822]="Czempioni! Usłyszałem znajomy głos, więc walczyłem ze mną w tym przeklętym miejscu.",
[3390493607]="Pentarus, słyszałeś panią. Niech twoi magowie podniosą osłonę i pozwolą przejść tym dzielnym duszom!",
[3390579478]="Dobrze... Czuję, jak wraca do mnie moja moc!",
[3390666387]="Co to ma być?! Czy mamusia i tatuś niczego cię nie nauczyli?!",
[3390711409]="A więc Tortolla powstał, by walczyć u naszego boku. Jesteś mądry, $n; ciężko jest zdobyć zaufanie starożytnego. On będzie oddanym kompanem.",
[3390753536]="Dziękuję wam... wam wszystkim. Zrobię, co w mojej mocy, aby dowieść, iż jestem godna waszego zaufania.",
[3390896846]="Walczcie na chwałę Przymierza, bohaterowie! Przynieście honor swemu królowi i waszym ludziom!",
[3390955587]="Cesarz będzie zachwycony, gdy pokażę mu twoją głowę, Shado-Pan.",
[3391044846]="Niech Światłość cię uleczy!",
[3391049442]="Doskonale! Wracaj prędko do Dalaran i spotkajmy się w Komnacie Strażnika. Bezpiecznego powrotu, Wielki Lordzie.",
[3391063819]="Możemy to wygrać!",
[3391199353]="Rytuał, który za chwilę przeprowadzę jest dość skomplikowany, potrwa jakiś czas, ale to jedyna droga na opuszczenie zasłony.",
[3391442840]="A co z tobą, Ji? Dołączysz do Hordy w ich drodze powrotnej?",
[3391520517]="Awatar Terokka!! Do broni!",
[3391670208]="Melka lo RAs vandar o nagan nud an",
[3391718532]="Matko Ziemio, prowadź nas.",
[3391873915]="Zawiedliśmy... boginię...",
[3392004717]="Tam idzie następny. Śmiem twierdzić, że ci złodzieje za każdym razem robią się coraz bardziej śmiali.",
[3392084306]="Cofnij się i unieś broń. Natchniemy ją częścią energii rady.",
[3392191254]="Zbierz załogę. Chcę aby każdy, nawet pijany korsarz znalazł się przy frontowej bramie.",
[3392643596]="Połamałeś KOLEJNE wiertło?! Gdzie je dostałeś, w Gitgeszeft?!",
[3392656849]="Ginormus poległ! $n wygląda jakby nawet się nie zmęczyła!",
[3392671217]="Dawno temu, Starzy Bogowie chcieli zawładnąć Wysoką Górą. Ich kampania wojenna była dowodzona przez okropną istotę z koszmaru... Uul'gynetha Ciemność.",
[3392689684]="Byłeś użyteczny dla Stoneplow, $n. Możliwe, że jeszcze cię wezwiemy. Ale zanim to nastąpi, powinieneś porozmawiać z naszym mistrzem lotów. Zabierze cię, dokądkolwiek zechcesz... bezpłatnie.",
[3392697231]="Pragnienie jest nie do wytrzymania...",
[3393187916]="Chrońcie wodza za wszelką cenę!",
[3393219432]="Wygląda na to, że czas wypuścić cię z tej klatki.",
[3393231291]="Przechodź. Wódź Wojenny czeka na ciebie.",
[3393283250]="Jeśli będziesz mieć szczęście, zjedzą najpierw twoją głowę....",
[3393324990]="Witajcie przyjaciele, zapraszam na największe wydarzenie na Azerocie! Wpadnijcie i weźcie udział we wszystkim co mamy do zaoferowania. Przejedźcie się na karuzelach i obejrzyjcie wystawy! Zadziwcie się cudami które odnalazł Festiwal Mrocznego Księżyca na tym wielkim i tajemniczym świecie! Nie szczędziliśmy wydatków, aby zapewnić rozrywkę dzieciom w każdym wieku!",
[3393328494]="Zostaw to w spokoju!",
[3393395578]="Popatrz $n, latamy na wodzie! Ale czad!",
[3393427088]="Można by pomyśleć, że miasto z kamienia jest mniej... łatwopalne.",
[3393499923]="Mam dla ciebie trochę zapasów. Odbierz je w strefach zrzutu zaznaczonych na twojej mapie.",
[3393502181]="Mój bałagan? MÓJ BAŁAGAN? Myślę, że to TY ją uruchomiłaś, nieznośny pypciu-",
[3393545292]="Dobrze jest polować z tobą. Dużo możemy się od siebie nauczyć.",
[3393616619]="Mam but i dokładnie wiem, gdzie go wsadzę!",
[3393686210]="Myślę, że próbuję powiedzieć... dzięki.",
[3393778995]="Uwolniłeś... mnie...",
[3393791831]="Zandalar... należy do Hordy.",
[3393888109]="Krwawy Bóg dostanie co mu się należy, teraz albo później. Nie powstrzymasz nas!",
[3393906667]="Straże... straże!",
[3394071810]="Nie pozwólcie im mnie zjeść...",
[3394161572]="Dopilnuj tego i przysyłaj mi raporty z waszych postępów.",
[3394226853]="Kolejny żółwik dotarł do wody!",
[3394244176]="Pamiętam was... w górach... Ale co... co to jest? Gdzie ja--",
[3394277659]="Streszczaj się, Sylvanas.",
[3394364781]="Dziękuje ci, ubrudzony ziemią przyjacielu, ale sami poruszamy się o wiele szybciej.",
[3394596279]="Pan Szkła, bóg z Pustki, który sam zwie się Xanem, uwięził mą duszę w krainie Pustki. Jej fragmenty zostały... wydarte... użyte przez klan Cienistego Księżyca na tutejszym cmentarzysku.",
[3394706570]="Gdzie ja jestem? Kim jesteś? Co to za dziwne uczucie?",
[3394719315]="Od morza do morza, od burzy do burzy, od fali do fali.",
[3394720565]="Musimy skończyć z krwawymi ofiarami! To kolejny krok ku powstrzymaniu krwawego boga.",
[3394908980]="%s wyje, ujawniając swą zdobycz!",
[3395038994]="Johnny jest chyba afk...",
[3395091839]="Przyjacielu, zatraceni są nieustępliwi w ataku na nasze smocze tereny. Zostawili nasze złapane młode głodujące z braku many!",
[3395149942]="Te paskudne harpie niech lepiej chowają się wśród drzew, albo dopilnujemy, żeby las został zasłany morzem piór i krwi.",
[3395406667]="$n przybył tu, aby zmierzyć się z Torokiem. Zabił Wiedźmę Lasu.",
[3395494687]="Potrzebujemy surowców, żeby ich odeprzeć. Rozproszcie się i przynieście mi trochę żelaza i drewna!",
[3395498760]="Tak bardzo ją kocham!",
[3395678151]="Dyniowe pole znajdziesz w obozie Rzecznogrzywych. Wybierz najbardziej soczyste okazy.",
[3395730564]="Rzucę cię do morza!",
[3395740473]="Moglibyśmy zostać na twojej farmie przez jakiś czas? Nie mamy zbyt wielu pieniędzy, ale z chęcią podzielę się z tobą odrobiną mojego słynnego piwa.",
[3395955612]="Wystąpcie, moi pobratymcy! Ucztujcie na ich ciałach!",
[3396120076]="No dobra, to dokąd pobiegła ta śliczna dziewuszka?",
[3396136302]="Ta dolina, dopóki żyję, pozostanie wolna!",
[3396201976]="Przepraszam za ten podstęp, ale było to konieczne.",
[3396215564]="Wiesz, mógłbym po prostu użyć iluzji... czemu się ukrywamy?",
[3396243867]="Dzięki piaskom, jesteś cały!",
[3396489240]="Druidzi, którzy opiekują się Szmaragdową Zatoką, nie wrócili z patrolu. Być może duszki coś knują...",
[3396575994]="Rozpoczęła się bitwa! Prowadź nas ku zwycięstwu!",
[3396598166]="... za cicho.",
[3396809847]="Pamiętaj, żeby wpaść do mnie ponownie!",
[3397025282]="Tak, dziwne. Wcześniej nie było tu drzwi.",
[3397026521]="Dolina Wiecznych Kwiatów staje się coraz bardziej intrygująca. Może po prostu muszę sam ją zobaczyć.",
[3397035873]="Trzymaj się blisko Yalii, by mogła cię leczyć!",
[3397183985]="Obcy muszą zostać oczyszczeni.",
[3397248365]="Sprawdźmy, czy naprawdę jest taka odporna.",
[3397260844]="Ciężki ból brzucha?",
[3397368531]="Paladynie, może pożyczyłbyś mi rękę? Potrzebuję tylko kolejnego leczenia. Dziękuję Ci.",
[3397442066]="Muszę wiedzieć... gdy przemówił do ciebie głos, każący ci mianować ją wodzem wojennym... co to był za duch?",
[3397510887]="Bądź uzdrowiony, bracie!",
[3397514741]="Dalaran spłonie!",
[3397577716]="Zidentyfikowano wrogą jednostkę.",
[3397788301]="Muszę dostać się głębiej, tam gdzie on czeka. Muszę skoczyć!",
[3397805331]="Myślę, że zatrzymam kilka waszych części jako trofeum.",
[3397891071]="Psst... krwawy elfie, tutaj! Obok zdechłego wieloryba.",
[3398025936]="To część testu. Tak... aby odnieść sukces, musisz skupić całą swoją energię w jednej pięści...",
[3398187527]="Musimy się spieszyć - te orki Cienistego Księżyca są dowodzone przez 'Ner'zhul'a.",
[3398282318]="Wszystko jest tak, jak mówi mój prorok. Teraz już wiesz, dlaczego trzymam go u swego boku.",
[3398502288]="Widzisz tą płonącą świecę? Masz czas dopóki ona się pali, aby opowiedzieć nam o pandareńskich artefaktach! Lepiej zacznij gadać!",
[3398536381]="Być może nie byłbym, gdyby nie wysiłki twojego przyjaciela.",
[3398639483]="Otwórzcie umysły!",
[3398692065]="Nie. Jedynie to, byśmy swoje wysiłki skierowali przeciw Azsharze, a nie Hordzie. To mogłoby kupić czas potrzebny rebelii Saurfang'a na zakorzenienie się.",
[3398699923]="Dobra robota, łowco! Potrafisz wykonywać proste polecenia.",
[3399026543]="Spotkajcie swój rozkwit!",
[3399046278]="To mój $n!",
[3399092166]="Czekajcie, przyjaciele! Musimy zdobyć informacje, zanim ten diabeł spotka swoje przeznaczenie!",
[3399113394]="Chronić uchodźców!",
[3399190893]="Chodź, zabawimy się nieco, mały!",
[3399202426]="Nie powinieneś był się wtrącać!",
[3399412901]="Wygląda dobrze jak dotąd.",
[3399627974]="Dziękuję za twą szczerość.",
[3399698825]="Przestrzegaj prawa!",
[3399902697]="$n? Hah! Jesteś ostatnim gladiatorem Sternfathoma.",
[3399965245]="Cierpliwości, drogi $n. Czas nie jest jeszcze do końca odpowiedni. Odpal tę flarę raz jeszcze za chwilę, a wtedy zaczniemy...",
[3399975726]="Noc zapada nad wami!",
[3400031549]="Bawić!",
[3400043442]="Dobrze więc, nieznajomi. Zyskaliście zaufanie naszego szamana. Nie odrzucę pomocy.",
[3400142085]="On... jeszcze zniewoli... tego tytana...",
[3400153918]="Dowiodłeś swej biegłości.",
[3400168343]="Uznajcie to za płonące ostrzeżenie! Haha!",
[3400197257]="Niechaj duchy nad tobą czuwają, przyjacielu. Ja muszę wrócić do Twierdzy Wojennej Pieśni.",
[3400240651]="Duchy wzywają... Jestem pochłonięty.",
[3400452247]="Jestem atakowany! Pomóż mi!",
[3400486923]="Wieść o przybyciu Przymierza musi roznieść się po mieście. Rozwieś szyldy, niech wszyscy wiedzą, że niebawem nadejdzie kres panowania Wielkiej Mistrzyni. Trzeba podnieść morale shal'dorei!",
[3400680193]="Gdy pozbędziemy się tych duchów, będziemy mogli ruszać dalej.",
[3400818138]="Niezależnie od tego, co robisz, lepiej nie angażować tej szalonej kobiety w lesie.",
[3400985840]="Śmierć cię znalazła!",
[3401049096]="Arakkoa są ukryci... wszędzie!",
[3401137233]="Bierzmy się za nich!",
[3401208547]="Musimy utrzymać tę grań, nie ważne, jakim kosztem.",
[3401336229]="Masz szczęście, że moje wilczki jeszcze nie dorosły, bo inaczej skończyłbyś jako ich posiłek.",
[3401388985]="Wygląda na to, że we wraku nadal są części artylerii!",
[3401646247]="Oni płaczą i błagają, jakby to robiło jakąś różnicę. I tak wszyscy umrą.",
[3401940500]="Azshara musi odpowiedzieć za swoje zbrodnie.",
[3401941474]="Kelsey, obserwuj wszystko z góry. Informuj mnie jeśli coś zobaczysz.",
[3402035510]="Jesteście tacy jak inni, czyż nie?",
[3402387894]="Gdzie jest Kamień Pływów? Mów, głupcze!",
