[4045036587]="Hmmm... Prawdopodobnie mój kompas. Nigdy mnie nie zawiódł! Przynajmniej, dopóki tu nie trafiłem. Ale trudno powiedzieć, że to wina kompasu, mam na myśli, że to nieożywiony obiekt, który trudno o coś winić--",
[4045041733]="HORDA ZGNIECIONA MOJĄ FURIĄ!",
