[4047274992]="Śmierć intruzom!",
[4047355461]="W ogóle nie rozumiem przyjęć goblinów.",
[4047355916]="Ustaliliśmy obszar niezbędny do dostarczenia naszych wojsk na linie frontu, tylko po to, by okazało się, że jest zamieszkały przez pająki. Spal ich gniazda!",
[4047392430]="Horda obroniła Twierdzę Wintergrasp!",
[4047431032]="Wiszę ci piwo!",
[4047518731]="Nie beze mnie.",
