[4047584609]="Zawróć.",
[4047641989]="Być może jestem teraz z Mglistymi Żaglami, ale jeśli myślisz, że zdradzę moich przodków z Przymierza, aby stanąć po stronie Hordy... jak śmiesz!",
[4047688425]="Inkwizytorze, wiem że Katherine planuje dołączyć do ciebie w tym szalonym zadaniu,",
