[4050958482]="Emmarel! Dowódco! Widzieliście to?",
[4051189938]="Dobrze wiem, co z tym zrobie, synu Hellscreama. Będę obserwował i czekał, gdy twoi ludzie powoli zaczną sobie zdawać sprawę z twojej niekompetencji. Będę się śmiał, gdy zaczną tobą gardzić tak, jak ja.",
