[4051958073]="To ty zbłądziłeś!",
[4052083219]="Było warto!",
[4052227777]="Nic? Jol, lepiej się pospiesz z tym lekarstwem...",
[4052267209]="Przez wielkie czyny odwagi i męstwa, Hyrja zasłużyła na tą najświętszą ceremonię. Zostanie wywyższona, jako jedna z moich wybranych val'kyrów, a jej imię będzie rozbrzmiewać w tych pozłacanych korytarzach przez wieczność.",
