[4056085226]="Może i nie obchodzi cię, czy twoi ludzie umierają, o ile robią to honorowo. Ale dla mnie, tę Hordę warto ocalić. Każdy, kto się z tym nie zgadza, nie zasługuje na to, by być jednym z nas.",
