[4056767809]="Mam wobec ciebie dług, kimkolwiek jesteś.",
[4056844199]="Pomocy! Jestem atakowany!",
[4057082643]="Część starożytnych zapisów, które znalazłem w innym miejscu, wydaje się wskazywać na populację tutejszych wilków. Zastanawiam się, co się z nimi stało...",
