[4057257791]="Chodźmy... zanim przyplącze się coś innego, aby zepsuć zabawę.",
[4057257832]="Hej! Uważaj!",
[4057268011]="Drugon powinien był zostać ukryty na swoim wzgórzu. Dziękuję ci bohaterze, moi ludzie, dzięki tobie są bezpieczniejsi.",
