[4065330497]="Tutaj jest. Wskakuj na nią!",
[4065345455]="Achhh, jest tu... sejf Harlana Sweeta.",
[4065764858]="Podążaj za mną, $n, przedstawię ci twojego trenera, Bipsi Frostflingera.",
